description:
The Royal Wedding Of Prince William &amp; Kate Middleton / BBC [HD720p]

BBC
Autorul scenariului: BBC
Actori: Prince William &amp; Kate Middleton
Durata: 1h 18mn 11s + 46mn 6s + 45mn 56s + 1h 12mn 26s + 42mn 12s + 53mn 15s
Limba: English


Huw Edwards, Sophie Raworth and Fiona Bruce present full, uninterrupted coverage of the wedding of Prince William and Catherine Middleton. As the prince and princess-in-waiting make their final preparations, Sophie Raworth invites some of the 1,900 guests at the ceremony to share their thoughts and feelings about the royal couple ahead of the service, while Alex Jones reports from Kate's home village, Bucklebury, where the locals will be out in force to cheer on their most-celebrated resident. Huw Edwards provides the commentary as the Archbishop of Canterbury presides over the marriage ceremony, before the newlyweds step out onto the balcony at Buckingham Palace in one of the most historic moments of our time.

Includes 6 parts:
Part One: Introduction to the day &amp; buildup - speaking to the crowds &amp; well-wishers - 1h 18mn 11s
Part One: Buildup - speaking to the crowds &amp; well-wishers + VIPs arrive @ the Abbey - 46mn 6s
Part Three: Groom &amp; Best man turn up &amp; Queen etc Royalty ready for kick off - 45mn 56s
Part Four: Kick off - Bride leaves hotel.. ride to the Abbey.. Vows..Service.. - 1h 12mn 26s
Part Five: Half time - leave Abbey - open carriage procession back to Buckingham Palace.. - 42mn 12s
Part Six: Buckingham Palace..the crowds... the kiss... - 53mn 15s
